function typeturaInit(a,b){function c(){document.body.style.setProperty("--tt-width",a.offsetWidth),b.forEach(a=>{a.style.setProperty("--tt-bind",a.offsetWidth)})}c(),window.addEventListener("resize",c);var d=document.createElement("style");d.innerHTML="body{--tt-ease:linear;--tt-max:1600;--tt-bind:var(--tt-width);}*{--tt-key:none;animation:var(--tt-key) 1s var(--tt-ease) 1 calc(-1s*var(--tt-bind)/var(--tt-max)) paused}",document.head.insertBefore(d,document.head.firstChild)}document.onreadystatechange=()=>{if("complete"===document.readyState){var a=document.getElementById("typetura")||document.body,b=document.querySelectorAll(".typetura");typeturaInit(a,b)}};